//This Function is for creating divs for movie products
function addToPage(a){
    for(var j=0; j< a.length;j++){
    var i="#"+a[j].id;
    var m= i+" img";
    var n= i+" .name";
    var c= i+" .category";
    var p= i+" .price";
    $('.products1').append('<section class="bd-highlight text-uppercase text-left font-weight-bold ml-5 border p-5 bg-white mb-5 " ><img/><p class="name name text-dark title text-center mt-2  p-1""></p><p class="category text-dark title text-left"></p><p class="price text-warning"></p></section>');
    $('.products1 section:last-child').attr('id',a[j].id);
    $(i).addClass(a[j].category);
    $(m).attr('src', a[j].picture_url);
    $(m).attr('alt',a[j].name+" poster");
    $(m).attr('title',a[j].name)
    $(n).text(a[j].name);
    $(c).text(a[j].category);
    $(p).text(a[j].price + " EGP");
    }
};

addToPage(products.movies);



