//This function is for the search bar 
$(".form-control").on("keyup", function () {
    var searchInput = $(this).val().toLowerCase();
    $(".name").each(function () {
        var s = $(this).text().toLowerCase();
        if (s.indexOf(searchInput) != -1) {
            $(this).parent().show();
        }
        else {
            $(this).parent().hide();
        }
    })
});


